904.docs:
Tests whether `&self` is [prefixed by](https://willowprotocol.org/specs/data-model/index.html#path_prefix) the given [`Path`].
[`Path`]s are always prefixed by themselves, and by the empty [`Path`].

#### Complexity

Runs in `O(n + m)`, where `n` is the total length of the longer [`Path`] in bytes, and `m` is the greatest number of [`Component`]s.

#### Examples

```
use willow25::prelude::*;
let p: Path = path!("/hi/ho");
assert!(p.is_prefixed_by(&Path::new()));
assert!(p.is_prefixed_by(&path!("/hi")));
assert!(p.is_prefixed_by(&path!("/hi/ho")));
assert!(!p.is_prefixed_by(&path!("/hi/gh")));
# Ok::<(), PathError>(())
```

550.docs:
Returns a reference to the inner [`SubspaceId`], if any.

```
use willow25::prelude::*;

let a1 = Area::new(Some([17; 32].into()), Path::new(), ..Timestamp::from(17));
assert_eq!(a1.subspace(), Some(&[17; 32].into()));

let a2 = Area::new(None, Path::new(), ..Timestamp::from(17));
assert_eq!(a2.subspace(), None);
```

[Definition](https://willowprotocol.org/specs/grouping-entries/#AreaSubspace).

146.docs:
Compares `self` to another entry by [timestamp](https://willowprotocol.org/specs/data-model/index.html#entry_timestamp), [payload_digest](https://willowprotocol.org/specs/data-model/index.html#entry_payload_digest) (in case of a tie), and [payload_length](https://willowprotocol.org/specs/data-model/index.html#entry_payload_length) third (in case of yet another tie). See also [`EntrylikeExt::is_newer_than`] and [`EntrylikeExt::is_older_than`].

Comparing recency is primarily important to determine [which entries overwrite each other](https://willowprotocol.org/specs/data-model/index.html#prefix_pruning); the [`EntrylikeExt::prunes`] method checks for that directly.

# Examples

```
use core::cmp::Ordering;
use willow25::prelude::*;

let entry = Entry::builder()
    .namespace_id([0; 32].into())
    .subspace_id([1; 32].into())
    .path(path!(""))
    .timestamp(12345)
    .payload_digest([1; 32].into())
    .payload_length(17)
    .build().unwrap();

assert_eq!(entry.cmp_recency(&entry), Ordering::Equal);

let lesser_timestamp = Entry::prefilled_builder(&entry).timestamp(5).build().unwrap();
assert_eq!(entry.cmp_recency(&lesser_timestamp), Ordering::Greater);

let lesser_digest = Entry::prefilled_builder(&entry).payload_digest([0; 32].into()).build().unwrap();
assert_eq!(entry.cmp_recency(&lesser_digest), Ordering::Greater);

let lesser_length = Entry::prefilled_builder(&entry).payload_length(0).build().unwrap();
assert_eq!(entry.cmp_recency(&lesser_length), Ordering::Greater);

let greater_timestamp = Entry::prefilled_builder(&entry).timestamp(999999).build().unwrap();
assert_eq!(entry.cmp_recency(&greater_timestamp), Ordering::Less);

let greater_digest = Entry::prefilled_builder(&entry).payload_digest([2; 32].into()).build().unwrap();
assert_eq!(entry.cmp_recency(&greater_digest), Ordering::Less);

let greater_length = Entry::prefilled_builder(&entry).payload_length(99).build().unwrap();
assert_eq!(entry.cmp_recency(&greater_length), Ordering::Less);
```

[Spec definition](https://willowprotocol.org/specs/data-model/index.html#entry_newer).

900.docs:
Returns whether `&self` has zero [`Component`]s.

#### Complexity

Runs in `O(1)`, performs no allocations.

#### Examples

```
use willow25::prelude::*;
assert_eq!(Path::new().is_empty(), true);

let p: Path = path!("/hi/ho");
assert_eq!(p.is_empty(), false);
# Ok::<(), PathError>(())
```

142.docs:
Returns whether `self` and `other` describe non-equal entries.

# Examples

```
use willow25::prelude::*;

let entry = Entry::builder()
    .namespace_id([0; 32].into())
    .subspace_id([1; 32].into())
    .path(path!(""))
    .timestamp(12345)
    .payload_digest([1; 32].into())
    .payload_length(17)
    .build().unwrap();

assert!(!entry.entry_ne(&entry));

let changed = Entry::prefilled_builder(&entry).timestamp(999999).build().unwrap();
assert!(entry.entry_ne(&changed));

```

469.docs:
Returns whether `self` is included in the intersection of the two given [`Range3ds`](Range3d).

```
use willow25::prelude::*;

let r1 = Range3d::new(.., .., ..Timestamp::from(17));
let r2 = Range3d::new(.., .., Timestamp::from(15)..);

assert!(
    (SubspaceId::from([5; 32]), Path::new(), Timestamp::from(16))
        .is_in_intersection(&r1, &r2)
);
assert!(
    !(SubspaceId::from([5; 32]), Path::new(), Timestamp::from(29))
        .is_in_intersection(&r1, &r2)
);
```

896.docs:
Creates a new [`Path`] by appending a slice of [`Component`]s to `&self`.

Creates a fully separate copy of the new data on the heap; which includes cloning all data in `&self`. To efficiently construct [`Path`]s, use [`Path::from_components`], [`Path::from_slices`], [`Path::from_components_iter`], [`Path::from_slices_iter`], or a [`PathBuilder`].

#### Complexity

Runs in `O(n + m)`, where `n` is the total length of the resulting [`Path`] in bytes, and `m` is the number of its [`Component`]s. Performs a single allocation of `O(n + m)` bytes.

#### Examples

```
use willow25::prelude::*;
let p0: Path = Path::new();
let p1 = p0.append_slices(&[b"hi", b"ho"])?;
assert_eq!(
    p1.append_slices(&[b"too_"]),
    Err(PathError::PathTooLong),
);
# Ok::<(), PathError>(())
```

719.docs:
Appends the data for the next [`Component`], from a slice of bytes.

#### Complexity

Runs in `O(component_length)` time. Performs no allocations.

#### Examples

```
use willow25::prelude::*;
let mut builder = PathBuilder::new(4, 2)?;
builder.append_slice(b"hi")?;
builder.append_slice(b"ho")?;
assert_eq!(builder.build(), path!("/hi/ho"));
# Ok::<(), PathError>(())
```

919.docs:
Returns the longest common [prefix](https://willowprotocol.org/specs/data-model/index.html#path_prefix) of `&self` and the given [`Path`].

#### Complexity

Runs in `O(n + m)`, where `n` is the total length of the shorter of the two [`Path`]s, and `m` is the lesser number of [`Component`]s. Performs a single allocation of `O(n + m)` bytes to create the return value.

#### Examples

```
use willow25::prelude::*;
let p1: Path = path!("/hi/ho");
let p2: Path = path!("/hi/he");
assert_eq!(p1.longest_common_prefix(&p2), Path::from_slice(b"hi")?);
# Ok::<(), PathError>(())
```

465.docs:
Returns whether `self` and `other` describe equal coordinates, i.e., whether their [subspace ids](Keylike::subspace_id), [paths](Keylike::path), and [timestamps](Coordinatelike::timestamp) are all equal.

# Examples

```
use willow25::prelude::*;

assert!(
    (SubspaceId::from([0; SUBSPACE_ID_WIDTH]), path!(""), Timestamp::from(25))
    .key_eq(&(SubspaceId::from([0; SUBSPACE_ID_WIDTH]), path!(""), Timestamp::from(25)))
);
assert!(
    !(SubspaceId::from([0; SUBSPACE_ID_WIDTH]), path!(""), Timestamp::from(25))
    .key_eq(&(SubspaceId::from([1; SUBSPACE_ID_WIDTH]), path!(""), Timestamp::from(25)))
);
assert!(
    !(SubspaceId::from([0; SUBSPACE_ID_WIDTH]), path!(""), Timestamp::from(25))
    .key_eq(&(SubspaceId::from([0; SUBSPACE_ID_WIDTH]), path!("/nope"), Timestamp::from(25)))
);
```

715.docs:
Creates a builder for a [`Path`] of known total length and component count.
The component data must be filled in before building.

#### Complexity

Runs in `O(total_length + component_count)`, performs a single allocation of `O(total_length + component_count)` bytes.

#### Examples

```
use willow25::prelude::*;
let mut builder = PathBuilder::new(4, 2)?;
builder.append_component(component!("hi"));
builder.append_slice(b"ho")?;
assert_eq!(builder.build(), path!("/hi/ho"));
# Ok::<(), PathError>(())
```

915.docs:
Creates an iterator over [owned handles](OwnedComponent) to the components of `&self`, starting at the `i`-th [`OwnedComponent`]. If `i` is greater than or equal to the number of [`OwnedComponent`], the iterator yields zero items.

Stepping the iterator takes `O(1)` time and performs no memory allocations.

#### Complexity

Runs in `O(1)`, performs no allocations.

#### Examples

```
use willow25::prelude::*;
let p: Path = path!("/hi/ho");
let mut comps = p.suffix_owned_components(1);
assert_eq!(comps.next(), Some(OwnedComponent::new(b"ho")?));
assert_eq!(comps.next(), None);
# Ok::<(), PathError>(())
```

888.docs:
Returns an empty [`Path`], i.e., a [`Path`] of zero [`Component`]s.

#### Complexity

Runs in `O(1)`.

#### Examples

```
use willow25::prelude::*;
assert_eq!(Path::new().component_count(), 0);
assert_eq!(Path::new(), Path::default());
assert_eq!(Path::new(), path!(""));
```

157.docs:
Sets the [timestamp](https://willowprotocol.org/specs/data-model/index.html#entry_timestamp) of the entry being built to the current time.

```
use willow25::prelude::*;

let entry = Entry::builder()
    .now().unwrap()
    .namespace_id([0; 32].into())
    .subspace_id([1; 32].into())
    .path(path!("/vacation/plan"))
    .payload_digest([77; 32].into())
    .payload_length(17)
    .build().unwrap();

assert!(entry.timestamp() > 814673376414009.into());
// 814673376414009 is the timestamp for 26.10.2025 afternoon-ish in Berlin.
```

484.docs:
Returns the [`Range3d`] which [includes](Range3d::includes) `coord` but no other value.

```
use willow25::prelude::*;

let r = Range3d::singleton(&([5; 32].into(), Path::new(), Timestamp::from(9)));

assert!(r.includes(&([5; 32].into(), Path::new(), Timestamp::from(9))));
assert!(!r.includes(&([5; 32].into(), Path::new(), Timestamp::from(10))));
