811.docs:
Creates an [`OwnedComponent`] by copying data from a byte slice. Returns [`None`] if the slice is longer than 4096 ([`MCL`]).

#### Complexity

Runs in `O(n)`, where `n` is the length of the slice. Performs a single allocation of `O(n)` bytes.

#### Examples

```
use willow25::prelude::*;
assert!(OwnedComponent::new(b"yay").is_ok());
assert!(OwnedComponent::new(b"too_").is_err());
```

911.docs:
Creates an iterator over the [`Component`]s of `&self`.

Stepping the iterator takes `O(1)` time and performs no memory allocations.

#### Complexity

Runs in `O(1)`, performs no allocations.

#### Examples

```
use willow25::prelude::*;
let p: Path = path!("/hi/ho");
let mut comps = p.components();
assert_eq!(comps.next(), Some(component!("hi")));
assert_eq!(comps.next(), Some(Component::new(b"ho")?));
assert_eq!(comps.next(), None);
# Ok::<(), PathError>(())
```

557.docs:
Returns whether an [`Entry`] of the given [coordinate](Coordinatelike) could possibly cause [prefix pruning](https://willowprotocol.org/specs/data-model/index.html#prefix_pruning) in this area.

```
use willow25::prelude::*;

let a = Area::new(Some([17; 32].into()), Path::new(), ..Timestamp::from(17));

assert!(a.admits_pruning_by(&([17; 32].into(), Path::new(), Timestamp::from(9))));
assert!(!a.admits_pruning_by(&([18; 32].into(), Path::new(), Timestamp::from(9))));
```

3.docs:
An immutable Willow [Path](https://willowprotocol.org/specs/data-model/index.html#Path). Thread-safe, cheap to clone, cheap to take prefixes of, expensive to append to (linear time complexity).

A Willow25 Path is any sequence of bytestrings  called [Components](https://willowprotocol.org/specs/data-model/index.html#Component)  fulfilling certain constraints:

- each [`Component`] has a length of at most 4096 ([`MCL`]),
- each [`Path`] has at most 4096 ([`MCC`]) components, and
- the total size in bytes of all [`Component`]s is at most 4096 ([`MPL`]).

This type statically enforces these invariants for all (safely) created instances.

Because appending [`Component`]s takes time linear in the length of the full [`Path`], you should not build up [`Path`]s this way. Instead, use [`Path::from_components`], [`Path::from_slices`], [`Path::from_components_iter`], [`Path::from_slices_iter`], or a [`PathBuilder`]. If you statically know the path in advance, use the [`path!`](path) macro.

```
use willow25::prelude::*;
let p: Path = path!("/hi/ho");

assert_eq!(p.component_count(), 2);
assert_eq!(p.component(1), Some(Component::new(b"ho")?));
assert_eq!(p.total_length(), 4);
assert!(p.is_prefixed_by(&Path::from_slice(b"hi")?));
assert_eq!(
    p.longest_common_prefix(&path!("/hi/he")),
    Path::from_slice(b"hi")?
);
# Ok::<(), PathError>(())
```

907.docs:
Returns the `i`-th [`Component`] of `&self`.

#### Complexity

Runs in `O(1)`, performs no allocations.

#### Examples

```
use willow25::prelude::*;
let p: Path = path!("/hi/ho");
assert_eq!(p.component(0), Some(component!("hi")));
assert_eq!(p.component(1), Some(Component::new(b"ho")?));
assert_eq!(p.component(2), None);
# Ok::<(), PathError>(())
```

630.docs:
Returns `true` iff this area of interest cannot possibly contain any entries.

```
use willow25::prelude::*;

assert!(
    !AreaOfInterest::new(
        Area::new(None, Path::new(), ..Timestamp::from(17)),
        5,
        400,
    ).is_empty(),
);
assert!(
    !AreaOfInterest::new(
        Area::new(None, Path::new(), ..Timestamp::from(17)),
        5,
        0, // Could still possibly contain entries with a payload_length of zero.
    ).is_empty(),
);

assert!(
    AreaOfInterest::new(
        Area::new(None, Path::new(), ..Timestamp::from(17)),
        0,
        400,
    ).is_empty(),
);
assert!(
    AreaOfInterest::new(
        Area::empty(),
        5,
        400,
    ).is_empty(),
);
```

376.docs:
An [`Area`](https://willowprotocol.org/specs/grouping-entries/#Area) is a box in three-dimensional willow space, consisting of all entries matching either a single [`SubspaceId`] or entries of arbitrary [`SubspaceIds`](SubspaceId), prefixed by some [`Path`], and a [`TimeRange`](super::TimeRange).

Areas are the default way by which application developers should aggregate entries. See [the specification](https://willowprotocol.org/specs/grouping-entries/#areas) for more details.

```
use willow25::prelude::*;

let a1 = Area::new(None, Path::new(), ..Timestamp::from(17));

assert!(a1.includes(&([5; 32].into(), Path::new(), Timestamp::from(9))));
assert_eq!(a1.subspace(), None);

let a2 = Area::new(Some([42; 32].into()), Path::new(), Timestamp::from(15)..);
assert_eq!(
    a1.intersection(&a2),
    Area::new(
        Some([42; 32].into()),
        Path::new(),
        Timestamp::from(15)..Timestamp::from(17),
    ),
);
```

[Specification](https://willowprotocol.org/specs/grouping-entries/#Area)

