903.docs:
Tests whether `&self` is a [prefix](https://willowprotocol.org/specs/data-model/index.html#path_prefix) of the given [`Path`].
[`Path`]s are always a prefix of themselves, and the empty [`Path`] is a prefix of every [`Path`].

#### Complexity

Runs in `O(n + m)`, where `n` is the total length of the longer [`Path`] in bytes, and `m` is the greatest number of [`Component`]s.

#### Examples

```
use willow25::prelude::*;
let p: Path = path!("/hi/ho");
assert!(Path::new().is_prefix_of(&p));
assert!(path!("/hi").is_prefix_of(&p));
assert!(path!("/hi/ho").is_prefix_of(&p));
assert!(!path!("/hi/gh").is_prefix_of(&p));
# Ok::<(), PathError>(())
```

549.docs:
Creates a new `Area` from its constituent optional [`SubspaceId`], [`Path`], and [`TimeRange`](super::TimeRange).

```
use willow25::prelude::*;

let a = Area::new(None, Path::new(), ..Timestamp::from(17));

assert!(a.includes(&([5; 32].into(), Path::new(), Timestamp::from(9))));
assert_eq!(a.subspace(), None);
```

372.docs:
An arbitrary box in three-dimensional willow space, consisting of a [`SubspaceRange`](super::SubspaceRange), a [`PathRange`](super::PathRange), and a [`TimeRange`](super::TimeRange).

As an application developer, you probably do not need to interact with 3d ranges, you should prefer [`Areas`](super::Area)  the latter work well with encrypted data, whereas 3d ranges do not define human-meaningful subsets of data when working with encryption.

```
use willow25::prelude::*;

let r = Range3d::new(.., .., ..Timestamp::from(17));

assert!(r.includes(&([5; 32].into(), Path::new(), Timestamp::from(9))));
assert_eq!(r.subspaces(), &WillowRange::from(..));

let r2 = Range3d::new(.., .., Timestamp::from(15)..);
assert_eq!(
    r.intersection(&r2),
    Range3d::new(.., .., Timestamp::from(15)..Timestamp::from(17)),
);
```

[Specification](https://willowprotocol.org/specs/grouping-entries/index.html#D3Range)

145.docs:
Returns whether this entry would [prefix prune](https://willowprotocol.org/specs/data-model/index.html#prefix_pruning) another entry.

Prefix pruning powers deletion in Willow: whenever a data store would contain two entries, one of which pruens the other, the other is removed from the data store (or never inserted in the first place). Informally speaking, newer entries remove older entries, but only if they are in the same namespace and subspace, and only if the path of the newer entry is a prefix of the path of the older entry.

More precisely: an entry `e1` prunes an entry `e2` if and only if

- `e1.namespace_id() == e2.namespace_id()`,
- `e1.subspace_id() == e2.subspace_id()`,
- `e1.path().is_prefix_of(e2.path())`, and
- `e1.is_newer_than(&e2)`.

This method is the reciprocal of [`EntrylikeExt::is_pruned_by`].

# Examples


```
use willow25::prelude::*;

let entry = Entry::builder()
    .namespace_id([0; 32].into())
    .subspace_id([1; 32].into())
    .path(path!("/a/b"))
    .timestamp(12345)
    .payload_digest([1; 32].into())
    .payload_length(17)
    .build().unwrap();

let newer = Entry::prefilled_builder(&entry).timestamp(99999).build().unwrap();
assert!(!entry.prunes(&newer));
assert!(newer.prunes(&entry));

let newer_and_prefix = Entry::prefilled_builder(&newer)
    .path(path!("/a")).build().unwrap();
assert!(!entry.prunes(&newer_and_prefix));
assert!(newer_and_prefix.prunes(&entry));

let newer_and_extension = Entry::prefilled_builder(&newer)
    .path(path!("/a/b/c")).build().unwrap();
assert!(!entry.prunes(&newer_and_extension));
assert!(!newer_and_extension.prunes(&entry));

let newer_but_unrelated_namespace = Entry::prefilled_builder(&newer)
    .namespace_id([17; 32].into()).build().unwrap();
assert!(!entry.prunes(&newer_but_unrelated_namespace));
assert!(!newer_but_unrelated_namespace.prunes(&entry));

let newer_but_unrelated_subspace = Entry::prefilled_builder(&newer)
    .subspace_id([3; 32].into()).build().unwrap();
assert!(!entry.prunes(&newer_but_unrelated_subspace));
assert!(!newer_but_unrelated_subspace.prunes(&entry));
# Ok::<(), PathError>(())
```

622.docs:
Creates a new `AreaOfInterest` from its constituent [`Area`], [max_count](https://willowprotocol.org/specs/grouping-entries/#aoi_count), and [max_size](https://willowprotocol.org/specs/grouping-entries/#aoi_size).

A [`max_count`](https://willowprotocol.org/specs/grouping-entries/#aoi_count) of [`u64::MAX`] indicates that there is no limit on the number of entries. A [`max_size`](https://willowprotocol.org/specs/grouping-entries/#aoi_size) of [`u64::MAX`] indicates that there is no limit on the total [payload_lengths](https://willowprotocol.org/specs/data-model/index.html#entry_payload_length) of the entries.

```
use willow25::prelude::*;

let aoi = AreaOfInterest::new(Area::new(None, Path::new(), ..Timestamp::from(17)), 5, 400);

assert_eq!(aoi.area(), &Area::new(None, Path::new(), ..Timestamp::from(17)));
assert_eq!(aoi.max_count(), 5);
assert_eq!(aoi.max_size(), 400);
```

