918.docs:
Creates an iterator over all [prefixes](https://willowprotocol.org/specs/data-model/index.html#path_prefix) of `&self` (including the empty [`Path`] and `&self` itself).

Stepping the iterator takes `O(1)` time and performs no memory allocations.

#### Complexity

Runs in `O(1)`, performs no allocations.

#### Examples

```
use willow25::prelude::*;
let p: Path = path!("/hi/ho");
let mut prefixes = p.all_prefixes();
assert_eq!(prefixes.next(), Some(Path::new()));
assert_eq!(prefixes.next(), Some(Path::from_slice(b"hi")?));
assert_eq!(prefixes.next(), Some(path!("/hi/ho")));
assert_eq!(prefixes.next(), None);
# Ok::<(), PathError>(())
```

10.docs:
Creates a builder which is prefilled with the data from some other entry.

Use this function to create modified copies of entries.

# Examples

```
use willow25::prelude::*;

// Supplying all necessary data yields an entry.
let first_entry = Entry::builder()
    .namespace_id([0; 32].into())
    .subspace_id([1; 32].into())
    .path(path!(""))
    .timestamp(12345)
    .payload_digest([77; 32].into())
    .payload_length(17)
    .build().unwrap();

assert_eq!(*first_entry.payload_digest(), [77; 32].into());

let second_entry = Entry::prefilled_builder(&first_entry)
    .timestamp(67890)
    .payload_digest([78; 32].into())
    .payload_length(4)
    .build().unwrap();

assert_eq!(*second_entry.payload_digest(), [78; 32].into());
```

714.docs:
A helper struct for creating a [`Path`] with exactly one memory allocation. Requires total length and component count to be known in advance.

Enforces that each [`Component`] has a length of at most 4096 ([`MCL`]), that each [`Path`] has at most 4096 ([`MCC`]) [`Component`]s, and that the total size in bytes of all [`Component`]s is at most 4096 ([`MPL`]).

```
use willow25::prelude::*;
let mut builder = PathBuilder::new(4, 2)?;
builder.append_component(component!("hi"));
builder.append_slice(b"ho")?;
assert_eq!(builder.build(), path!("/hi/ho"));
# Ok::<(), PathError>(())
```

