902.docs:
Returns the sum of the lengths of the first `i` [`Component`]s in `&self`; panics if `i >= self.component_count()`. More efficient than `path.create_prefix(i).path_length()`.

Guaranteed to be at most `MCC`.

#### Complexity

Runs in `O(1)`, performs no allocations.

#### Examples

```
use willow25::prelude::*;
let p: Path = path!("/hi/ho");
assert_eq!(p.total_length_of_prefix(0), 0);
assert_eq!(p.total_length_of_prefix(1), 2);
assert_eq!(p.total_length_of_prefix(2), 4);
# Ok::<(), PathError>(())
```

625.docs:
Returns the [max_count](https://willowprotocol.org/specs/grouping-entries/#aoi_count) of entries.

A [`max_size`](https://willowprotocol.org/specs/grouping-entries/#aoi_size) of [`u64::MAX`] indicates that there is no limit on the total [payload_lengths](https://willowprotocol.org/specs/data-model/index.html#entry_payload_length) of the entries in this area of interest.

```
use willow25::prelude::*;

let aoi = AreaOfInterest::new(Area::new(None, Path::new(), ..Timestamp::from(17)), 5, 400);
assert_eq!(aoi.max_size(), 400);
```

[Definition](https://willowprotocol.org/specs/grouping-entries/#AreaPath).

144.docs:
Returns whether this entry is strictly [older](https://willowprotocol.org/specs/data-model/index.html#entry_newer) than another entry. See also [`EntrylikeExt::cmp_recency`] and [`EntrylikeExt::is_newer_than`].

Comparing recency is primarily important to determine [which entries overwrite each other](https://willowprotocol.org/specs/data-model/index.html#prefix_pruning); the [`EntrylikeExt::prunes`] method checks for that directly.

# Examples

```
use willow25::prelude::*;

let entry = Entry::builder()
    .namespace_id([0; 32].into())
    .subspace_id([1; 32].into())
    .path(path!(""))
    .timestamp(12345)
    .payload_digest([1; 32].into())
    .payload_length(17)
    .build().unwrap();

assert!(!entry.is_older_than(&entry));

let lesser_timestamp = Entry::prefilled_builder(&entry).timestamp(5).build().unwrap();
assert!(!entry.is_older_than(&lesser_timestamp));

let lesser_digest = Entry::prefilled_builder(&entry).payload_digest([0; 32].into()).build().unwrap();
assert!(!entry.is_older_than(&lesser_digest));

let lesser_length = Entry::prefilled_builder(&entry).payload_length(0).build().unwrap();
assert!(!entry.is_older_than(&lesser_length));

let greater_timestamp = Entry::prefilled_builder(&entry).timestamp(999999).build().unwrap();
assert!(entry.is_older_than(&greater_timestamp));

let greater_digest = Entry::prefilled_builder(&entry).payload_digest([2; 32].into()).build().unwrap();
assert!(entry.is_older_than(&greater_digest));

let greater_length = Entry::prefilled_builder(&entry).payload_length(99).build().unwrap();
assert!(entry.is_older_than(&greater_length));
```

621.docs:
An [`AreaOfInterest`](https://willowprotocol.org/specs/grouping-entries/#Area) is an [`Area`] together with a maximum number of entries it may include, and a maximum sum of total [payload_lengths](https://willowprotocol.org/specs/data-model/index.html#entry_payload_length) for the included entries.

A [`max_count`](https://willowprotocol.org/specs/grouping-entries/#aoi_count) of [`u64::MAX`] indicates that there is no limit on the number of entries. A [`max_size`](https://willowprotocol.org/specs/grouping-entries/#aoi_size) of [`u64::MAX`] indicates that there is no limit on the total [payload_lengths](https://willowprotocol.org/specs/data-model/index.html#entry_payload_length) of the entries.

```
use willow25::prelude::*;

let aoi = AreaOfInterest::new(Area::new(None, Path::new(), ..Timestamp::from(17)), 5, 400);

assert_eq!(aoi.area(), &Area::new(None, Path::new(), ..Timestamp::from(17)));
assert_eq!(aoi.max_count(), 5);
assert_eq!(aoi.max_size(), 400);
```

[Specification](https://willowprotocol.org/specs/grouping-entries/#aois)

