#### Complexity

Runs in `O(n + m)`, where `n` is the total length of the longer [`Path`] in bytes, and `m` is the greatest number of [`Component`]s.

#### Examples

```
use willow25::prelude::*;
let p: Path = Path::from_slice(b"hi")?;
assert!(p.is_related_to(&Path::new()));
assert!(p.is_related_to(&path!("/hi")));
assert!(p.is_related_to(&path!("/hi/ho")));
assert!(!p.is_related_to(&path!("/no")));
# Ok::<(), PathError>(())
```

551.docs:
Returns a reference to the inner [`Path`].

```
use willow25::prelude::*;

let a = Area::new(Some([17; 32].into()), Path::new(), ..Timestamp::from(17));
assert_eq!(a.path(), &Path::new());
```

[Definition](https://willowprotocol.org/specs/grouping-entries/#AreaPath).

147.docs:
Returns whether this entry would be [prefix pruned](https://willowprotocol.org/specs/data-model/index.html#prefix_pruning) by another entry.

Prefix pruning powers deletion in Willow: whenever a data store would contain two entries, one of which pruens the other, the other is removed from the data store (or never inserted in the first place). Informally speaking, newer entries remove older entries, but only if they are in the same namespace and subspace, and only if the path of the newer entry is a prefix of the path of the older entry.

More precisely: an entry `e1` prunes an entry `e2` if and only if

- `e1.namespace_id() == e2.namespace_id()`,
- `e1.subspace_id() == e2.subspace_id()`,
- `e1.path().is_prefix_of(e2.path())`, and
- `e1.is_newer_than(&e2)`.

This method is the reciprocal of [`EntrylikeExt::prunes`].

# Examples


```
use willow25::prelude::*;

let entry = Entry::builder()
    .namespace_id([0; 32].into())
    .subspace_id([1; 32].into())
    .path(path!("/a/b"))
    .timestamp(12345)
    .payload_digest([1; 32].into())
    .payload_length(17)
    .build().unwrap();

let newer = Entry::prefilled_builder(&entry).timestamp(99999).build().unwrap();
assert!(entry.is_pruned_by(&newer));
assert!(!newer.is_pruned_by(&entry));

let newer_and_prefix = Entry::prefilled_builder(&newer)
    .path(path!("/a")).build().unwrap();
assert!(entry.is_pruned_by(&newer_and_prefix));
assert!(!newer_and_prefix.is_pruned_by(&entry));

let newer_and_extension = Entry::prefilled_builder(&newer)
    .path(path!("/a/b/c")).build().unwrap();
assert!(!entry.is_pruned_by(&newer_and_extension));
assert!(!newer_and_extension.is_pruned_by(&entry));

let newer_but_unrelated_namespace = Entry::prefilled_builder(&newer)
    .namespace_id([17; 32].into()).build().unwrap();
assert!(!entry.is_pruned_by(&newer_but_unrelated_namespace));
assert!(!newer_but_unrelated_namespace.is_pruned_by(&entry));

let newer_but_unrelated_subspace = Entry::prefilled_builder(&newer)
    .subspace_id([3; 32].into()).build().unwrap();
assert!(!entry.is_pruned_by(&newer_but_unrelated_subspace));
assert!(!newer_but_unrelated_subspace.is_pruned_by(&entry));
# Ok::<(), PathError>(())
```

624.docs:
Returns the [max_count](https://willowprotocol.org/specs/grouping-entries/#aoi_count) of entries.

A [`max_count`](https://willowprotocol.org/specs/grouping-entries/#aoi_count) of [`u64::MAX`] indicates that there is no limit on the number of entries in this area of interest.

```
use willow25::prelude::*;

let aoi = AreaOfInterest::new(Area::new(None, Path::new(), ..Timestamp::from(17)), 5, 400);
assert_eq!(aoi.max_count(), 5);
```

[Definition](https://willowprotocol.org/specs/grouping-entries/#AreaPath).

143.docs:
Returns whether this entry is strictly [newer](https://willowprotocol.org/specs/data-model/index.html#entry_newer) than another entry. See also [`EntrylikeExt::cmp_recency`] and [`EntrylikeExt::is_older_than`].

Comparing recency is primarily important to determine [which entries overwrite each other](https://willowprotocol.org/specs/data-model/index.html#prefix_pruning); the [`EntrylikeExt::prunes`] method checks for that directly.

# Examples

```
use willow25::prelude::*;

let entry = Entry::builder()
    .namespace_id([0; 32].into())
    .subspace_id([1; 32].into())
    .path(path!(""))
    .timestamp(12345)
    .payload_digest([1; 32].into())
    .payload_length(17)
    .build().unwrap();

assert!(!entry.is_newer_than(&entry));

let lesser_timestamp = Entry::prefilled_builder(&entry).timestamp(5).build().unwrap();
assert!(entry.is_newer_than(&lesser_timestamp));

let lesser_digest = Entry::prefilled_builder(&entry).payload_digest([0; 32].into()).build().unwrap();
assert!(entry.is_newer_than(&lesser_digest));

let lesser_length = Entry::prefilled_builder(&entry).payload_length(0).build().unwrap();
assert!(entry.is_newer_than(&lesser_length));

let greater_timestamp = Entry::prefilled_builder(&entry).timestamp(999999).build().unwrap();
assert!(!entry.is_newer_than(&greater_timestamp));

let greater_digest = Entry::prefilled_builder(&entry).payload_digest([2; 32].into()).build().unwrap();
assert!(!entry.is_newer_than(&greater_digest));

let greater_length = Entry::prefilled_builder(&entry).payload_length(99).build().unwrap();
assert!(!entry.is_newer_than(&greater_length));
```

897.docs:
Creates a new [`Path`] by appending another [`Path`] to `&self`.

Creates a fully separate copy of the new data on the heap; which includes cloning all data in `&self` and in `&other`.

#### Complexity

Runs in `O(n + m)`, where `n` is the total length of the resulting [`Path`] in bytes, and `m` is the number of its [`Component`]s. Performs a single allocation of `O(n + m)` bytes.

#### Examples

```
use willow25::prelude::*;
let p0: Path = Path::new();
let p1 = p0.append_path(&path!("/hi/ho"))?;
assert_eq!(
    p1.append_path(&Path::from_slice(b"too_")?),
    Err(PathFromComponentsError::PathTooLong),
);
# Ok::<(), PathError>(())
```

466.docs:
Returns whether `self` and `other` describe non-equal coordinates, i.e., whether their [subspace ids](Keylike::subspace_id), [paths](Keylike::path), and [timestamps](Coordinatelike::timestamp) are not all equal.

# Examples

```
use willow25::prelude::*;

assert!(
    !(SubspaceId::from([0; SUBSPACE_ID_WIDTH]), path!(""), Timestamp::from(25))
        .coordinate_ne(
            &(SubspaceId::from([0; SUBSPACE_ID_WIDTH]), path!(""), Timestamp::from(25)),
        )
);
assert!(
    (SubspaceId::from([0; SUBSPACE_ID_WIDTH]), path!(""), Timestamp::from(25))
        .coordinate_ne(
            &(SubspaceId::from([1; SUBSPACE_ID_WIDTH]), path!(""), Timestamp::from(25))
        )
);
assert!(
    (SubspaceId::from([0; SUBSPACE_ID_WIDTH]), path!(""), Timestamp::from(25))
        .coordinate_ne(
            &(SubspaceId::from([0; SUBSPACE_ID_WIDTH]), path!("/nope"), Timestamp::from(25))
        )
);
```

893.docs:
Creates a new [`Path`] by appending a [`Component`] to `&self`.

Creates a fully separate copy of the new data on the heap; which includes cloning all data in `&self`. To efficiently construct [`Path`]s, use [`Path::from_components`], [`Path::from_slices`], [`Path::from_components_iter`], [`Path::from_slices_iter`], or a [`PathBuilder`].

#### Complexity

Runs in `O(n + m)`, where `n` is the total length of the resulting [`Path`] in bytes, and `m` is the number of its [`Component`]s. Performs a single allocation of `O(n + m)` bytes.

#### Examples

```
use willow25::prelude::*;
let p0: Path = Path::new();
let p1 = p0.append_component(component!("hi"))?;
let p2 = p1.append_component(component!("ho"))?;
assert_eq!(
    p2.append_component(component!("too_")),
    Err(PathFromComponentsError::PathTooLong),
);
# Ok::<(), PathError>(())
```

916.docs:
Creates a new [`Path`] that consists of the first `component_count` [`Component`]s of `&self`. More efficient than creating a new [`Path`] from scratch.

Returns [`None`] if `component_count` is greater than `self.get_component_count()`.

#### Complexity

Runs in `O(1)`, performs no allocations.

#### Examples

```
use willow25::prelude::*;
let p: Path = path!("/hi/ho");
assert_eq!(p.create_prefix(0), Some(Path::new()));
assert_eq!(p.create_prefix(1), Some(Path::from_slice(b"hi")?));
assert_eq!(p.create_prefix(2), Some(path!("/hi/ho")));
assert_eq!(p.create_prefix(3), None);
# Ok::<(), PathError>(())
```

485.docs:
Returns the `Range3d` which [includes](Range3d::includes) every [coordinate](Coordinatelike).

```
use willow25::prelude::*;

let r = Range3d::full();

assert!(r.includes(&([5; 32].into(), Path::new(), Timestamp::from(9))));
assert!(r.includes(&([5; 32].into(), Path::new(), Timestamp::from(10))));
```

458.docs:
Returns whether `self` and `other` describe equal keys, i.e., whether their [subspace ids](Keylike::subspace_id) and [paths](Keylike::path) are both equal.

# Examples

```
use willow25::prelude::*;

assert!(
    (SubspaceId::from([0; SUBSPACE_ID_WIDTH]), path!(""))
    .key_eq(&(SubspaceId::from([0; SUBSPACE_ID_WIDTH]), path!("")))
);
assert!(
    !(SubspaceId::from([0; SUBSPACE_ID_WIDTH]), path!(""))
    .key_eq(&(SubspaceId::from([1; SUBSPACE_ID_WIDTH]), path!("")))
);
assert!(
    !(SubspaceId::from([0; SUBSPACE_ID_WIDTH]), path!(""))
    .key_eq(&(SubspaceId::from([0; SUBSPACE_ID_WIDTH]), path!("/nope")))
);
```

885.docs:
Create a new [`Path`] from a slice of byte slices.

#### Complexity

Runs in `O(n + m)`, where `n` is the total length of the created [`Path`] in bytes, and `m` is the number of its [`Component`]s. Performs a single allocation of `O(n + m)` bytes.

# Example

```
use willow25::prelude::*;
// Ok
let path = Path::from_slices(&[b"alfie", b"notes"]).unwrap();

// Err
let result1 = Path::from_slices(&[
  b"",
  b"",
]);
assert_eq!(result1, Err(PathError::PathTooLong));

// Err
let result2 = Path::from_slices(vec![b"".as_slice(); MCC + 1].as_slice());
assert_eq!(result2, Err(PathError::TooManyComponents));
```

